/** @ignore */
const bsplit = require('binary-split')
/** @ignore */
const untildify = require('untildify')
/** @ignore */
const fs = require('fs-extra')
const EventEmitter = require('eventemitter3')
const WARCRecorderBuilder = require('../warcRecordBuilder')
const warcFieldIdentifiers = require('./fieldIdentifiers')

/**
 * @desc Parse a WARC file
 * @extends {EventEmitter}
 * @example
 *  const parser = new WARCParser('<path-to-warcfile>')
 *  parser.on('record', record => { console.log(record) })
 *  parser.on('done', finalRecord => { console.log(finalRecord) })
 *  parser.on('error', error => { console.error(error) })
 *  parser.start()
 * @example
 *  const parser = new WARCParser()
 *  parser.on('record', record => { console.log(record) })
 *  parser.on('done', finalRecord => { console.log(finalRecord) })
 *  parser.on('error', error => { console.error(error) })
 *  parser.parseWARC('<path-to-warcfile>')
 */
class WARCParser extends EventEmitter {
  /**
   * @desc Create a new WARCParser
   * @param {string} wp path to the warc file tobe parsed
   */
  constructor (wp) {
    super()
    /**
     * @type {string} the path to the WARC file to be parsed
     * @private
     */
    this._wp = wp

    /**
     * @type {ReadStream} the underlying ReadStream
     * @private
     */
    this._readStream = null

    /**
     * @type {boolean} should the parser check the current lines buffer for the warctype
     * @private
     */
    this._checkRecType = false

    /**
     * @type {boolean} have we identified the records correct WARC-Type for the record
     * @private
     */
    this._foundType = false

    /**
     * @type {boolean} is the parser just starting to parse the WARC file
     * @private
     */
    this._starting = true

    /**
     * @type {boolean} is the parser currently parsing the WARC
     * @private
     */
    this._parsing = false

    /**
     * @type {{count: number, increment: function, reset: function}}
     * @private
     */
    this._crlfCounter = {
      count: 0,
      increment () {
        this.count += 1
      },
      reset () {
        this.count = 0
      }
    }
    /**
     * @type {WARCRecorderBuilder}
     * @private
     */
    this._builder = new WARCRecorderBuilder()
  }

  /**
   * @desc Begin parsing the WARC file. Once the start method has been called the parser will begin emitting
   * @emits {record} emitted when the parser has parsed a full record, the argument supplied to the listener will be the parsed record
   * @emits {done} emitted when the WARC file has been completely parsed, the argument supplied to the listener will be last record
   * @emits {error} emitted if an exception occurs, the argument supplied to the listener will be the error that occurred.
   * @return {boolean} indication if the parser has begun or is currently parsing a WARC file
   * - true: indicates the parser has begun parsing the WARC file true
   * - false: indicated the parser is currently parsing a WARC file
   * @throws {Error} if the path to the WARC file is null or undefined
   */
  start () {
    if (!this._parsing) {
      if (this._wp === null || this._wp === undefined) {
        throw new Error('The path to the WARC file is undefined')
      }
      this._parsing = true
      let lastBegin
      let buildKey
      let isEmptyLine
      this._readStream = fs.createReadStream(untildify(this._wp))
      this._readStream.pipe(bsplit())
        .on('data', (line) => {
          if (warcFieldIdentifiers.begin.equals(line)) {
            if (!this._starting) {
              this.emit('record', this._builder.buildRecord(buildKey))
            } else {
              this._starting = false
            }
            this._crlfCounter.reset()
            this._checkRecType = true
            lastBegin = line
          } else {
            isEmptyLine = warcFieldIdentifiers.empty.equals(line)
            if (this._checkRecType && !isEmptyLine) {
              buildKey = this._checkType(line, lastBegin)
            } else if (isEmptyLine) {
              this._crlfCounter.increment()
            } else {
              this._builder.addLineTo(buildKey, this._crlfCounter.count, line)
            }
          }
        })
        .on('error', error => {
          this.emit('error', error)
        })
        .on('end', () => {
          this._parsing = false
          this.emit('done', this._builder.buildRecord(buildKey))
          this._readStream.destroy()
        })
    } else {
      return false
    }
  }

  /**
   * @desc Alias for {@link start} except that you can supply the path to the WARC file to be parsed
   * if one was not supplied via the constructor or to parse another WARC file. If the path to WARC file
   * to be parsed was supplied via the constructor and you supply a different path to this method.
   * It will override the one supplied via the constructor
   * @param {?string} wp the path to the WARC file to be parsed
   * @return {boolean} indication if the parser has begun or is currently parsing a WARC file
   * @throws {Error} if the path to the WARC file is null or undefined
   */
  parseWARC (wp) {
    if (!this._parsing) {
      this._wp = wp || this._wp
    }
    return this.start()
  }

  /**
   * @desc determine the WARC-Type for the record
   * @param {Buffer} line the WARC-Type line
   * @param {Buffer} lastBegin the WARC/1.0 line (WARC record begin)
   * @return {Symbol} the record key that identifies the WARC-Type being parsed
   * @private
   */
  _checkType (line, lastBegin) {
    this._checkRecType = false
    this._foundType = warcFieldIdentifiers.req.equals(line)
    if (this._foundType) {
      return this._builder.initReq(lastBegin, line)
    } else {
      this._foundType = warcFieldIdentifiers.res.equals(line)
      if (this._foundType) {
        return this._builder.initRes(lastBegin, line)
      } else {
        this._foundType = warcFieldIdentifiers.info.equals(line)
        if (this._foundType) {
          return this._builder.initInfo(lastBegin, line)
        } else {
          this._foundType = warcFieldIdentifiers.mdata.equals(line)
          if (this._foundType) {
            return this._builder.initMdata(lastBegin, line)
          } else {
            // console.log('unknown warc type', line.toString())
          }
        }
      }
    }

    this._foundType = false
  }
}

module.exports = WARCParser

/**
 * @desc Keys used by {@link WARCRecorderBuilder} to identify which WARC Record is currently being built
 * @type {{builderKeyInfo: Symbol, builderKeyMdata: Symbol, builderKeyReq: Symbol, builderKeyRes: Symbol}}
 */
const buildKeys = {
  builderKeyInfo: Symbol('info'),
  builderKeyMdata: Symbol('mdata'),
  builderKeyReq: Symbol('req'),
  builderKeyRes: Symbol('res')
}

module.exports = buildKeys

/** @ignore */
const {builderKeyInfo, builderKeyMdata, builderKeyReq, builderKeyRes} = require('./buildKeys')
/** @ignore */
const {WARCInfoRecord, WARCMetaDataRecord, WARCRequestRecord, WARCResponseRecord} = require('../warcRecords')

/**
 * @desc Builds WARC Records by keeping track internally of the current WARC Record WARC-TYPE being parsed
 * by a parser e.g. {@link WARCParser}
 */
class WARCRecorderBuilder {
  /**
   * @desc Construct a new WARCRecorderBuilder
   */
  constructor () {
    this._info = new Map()
    this._mdata = new Map()
    this._req = new Map()
    this._res = new Map()
  }

  /**
   * @desc Begin building WARC-TYPE: warcinfo
   * @param {Buffer} bgn the WARC/1.0 line
   * @param {Buffer} line the WARC-TYPE line
   * @return {Symbol} the internal record key for the warcinfo record currently being built
   */
  initInfo (bgn, line) {
    this._info.clear()
    this._info.set('header', [bgn, line])
    this._info.set('content', [])
    return builderKeyInfo
  }

  /**
   * @desc Begin building WARC-TYPE: metadata
   * @param {Buffer} bgn the WARC/1.0 line
   * @param {Buffer} line the WARC-TYPE line
   * @return {Symbol} the internal record key for the metadata record currently being built
   */
  initMdata (bgn, line) {
    this._mdata.clear()
    this._mdata.set('header', [bgn, line])
    this._mdata.set('content', [])
    return builderKeyMdata
  }

  /**
   * @desc Begin building WARC-TYPE: request
   * @param {Buffer} bgn the WARC/1.0 line
   * @param {Buffer} line the WARC-TYPE line
   * @return {Symbol} the internal record key for the request record currently being built
   */
  initReq (bgn, line) {
    this._req.clear()
    this._req.set('header', [bgn, line])
    this._req.set('http', [])
    this._req.set('post', [])
    return builderKeyReq
  }

  /**
   * @desc Begin building WARC-TYPE: response
   * @param {Buffer} bgn the WARC/1.0 line
   * @param {Buffer} line the WARC-TYPE line
   * @return {Symbol} the internal record key for the response record currently being built
   */
  initRes (bgn, line) {
    this._res.clear()
    this._res.set('header', [bgn, line])
    this._res.set('http', [])
    this._res.set('body', [])
    return builderKeyRes
  }

  /**
   * @desc Add the current line being parsed to a record currently being built
   * @param {Symbol} key the internal record key for the response record currently being built exposed by
   * {@link initInfo}, {@link initMdata}, {@link initRes} and {@link initReq}
   * @param {number} ctrlfCount the current count of Control LineFeeds between WARC Record parts
   * @param {Buffer} line the current line being parsed
   */
  addLineTo (key, ctrlfCount, line) {
    switch (key) {
      case builderKeyInfo:
        this._addInfoLine(ctrlfCount, line)
        break
      case builderKeyMdata:
        this._addMdataLine(ctrlfCount, line)
        break
      case builderKeyReq:
        this._addReqLine(ctrlfCount, line)
        break
      case builderKeyRes:
        this._addResLine(ctrlfCount, line)
        break
    }
  }

  /**
   * @desc Build the record currently being parsed
   * @param {Symbol} key the internal record key for the response record currently being built exposed by
   * {@link initInfo}, {@link initMdata}, {@link initRes} and {@link initReq}
   * @return {WARCInfoRecord|WARCMetaDataRecord|WARCRequestRecord|WARCResponseRecord} based off the ``key`` supplied to
   * this method
   */
  buildRecord (key) {
    let record
    switch (key) {
      case builderKeyInfo:
        record = new WARCInfoRecord(...this._info.values())
        this._info.clear()
        break
      case builderKeyMdata:
        record = new WARCMetaDataRecord(...this._mdata.values())
        this._mdata.clear()
        break
      case builderKeyReq:
        record = new WARCRequestRecord(...this._req.values())
        this._req.clear()
        break
      case builderKeyRes:
        record = new WARCResponseRecord(...this._res.values())
        this._res.clear()
        break
    }
    return record
  }

  /**
   * @desc Adds the line to the correct WARC record section for warcinfo
   * @param {number} ctrlfCount the current count of Control LineFeeds between WARC Record parts
   * @param {Buffer} line the current line being parsed
   * @private
   */
  _addInfoLine (ctrlfCount, line) {
    if (ctrlfCount === 0) {
      this._info.get('header').push(line)
    } else if (ctrlfCount === 1) {
      this._info.get('content').push(line)
    }
  }

  /**
   * @desc Adds the line to the correct WARC record section for metadata
   * @param {number} ctrlfCount the current count of Control LineFeeds between WARC Record parts
   * @param {Buffer} line the current line being parsed
   * @private
   */
  _addMdataLine (ctrlfCount, line) {
    if (ctrlfCount === 0) {
      this._mdata.get('header').push(line)
    } else if (ctrlfCount === 1) {
      this._mdata.get('content').push(line)
    }
  }

  /**
   * @desc Adds the line to the correct WARC record section for request
   * @param {number} ctrlfCount the current count of Control LineFeeds between WARC Record parts
   * @param {Buffer} line the current line being parsed
   * @private
   */
  _addReqLine (ctrlfCount, line) {
    if (ctrlfCount === 0) {
      this._req.get('header').push(line)
    } else if (ctrlfCount === 1) {
      this._req.get('http').push(line)
    } else if (ctrlfCount === 2) {
      this._req.get('post').push(line)
    }
  }

  /**
   * @desc Adds the line to the correct WARC record section for response
   * @param {number} ctrlfCount the current count of Control LineFeeds between WARC Record parts
   * @param {Buffer} line the current line being parsed
   * @private
   */
  _addResLine (ctrlfCount, line) {
    if (ctrlfCount === 0) {
      this._res.get('header').push(line)
    } else if (ctrlfCount === 1) {
      this._res.get('http').push(line)
    } else if (ctrlfCount === 2) {
      this._res.get('body').push(line)
    }
  }
}

module.exports = WARCRecorderBuilder

/** @ignore */
const {parseWarcInfoMetaDataContent, parseWarcRecordHeader, headerRe} = require('./warcContentParsers')

/**
 * @desc WARC-TYPE: warcinfo
 */
class WARCInfoRecord {
  /**
   * @desc Create a new WARCInfoRecord
   * @param {Buffer[]} headerBuffers the warc header fields
   * @param {Buffer[]} contentBuffers the warc records contents
   */
  constructor (headerBuffers, contentBuffers) {
    /**
     * @type {Object}
     */
    this.warcHeader = parseWarcRecordHeader(headerBuffers)

    /**
     * @type {Object}
     */
    this.content = parseWarcInfoMetaDataContent(contentBuffers)

    /**
     * @type {string}
     */
    this.type = 'warcinfo'
  }

  /**
   * @return {string} WARC-TYPE
   */
  get warcType () {
    return this.warcHeader['WARC-Type']
  }

  /**
   * @return {string} WARC-Filename
   */
  get warcFilename () {
    return this.warcHeader['WARC-Filename']
  }

  /**
   * @return {string} WARC-Record-ID
   */
  get recordId () {
    return this.warcHeader['WARC-Record-ID']
  }

  /**
   * @return {string} WARC-HEADER:Content-Type
   */
  get warcContentType () {
    return this.warcHeader['Content-Type']
  }

  /**
   * @return {number} WARC-HEADER:Content-Length
   */
  get warcContentLength () {
    return this.warcHeader['Content-Length']
  }
}

