}

/**
 * @desc WARC-TYPE: request
 */
class WARCRequestRecord {
  /**
   * @desc Create a new WARCRequestRecord
   * @param {Buffer[]} headerBuffers
   * @param {Buffer[]} httpBuffers
   * @param {Buffer[]} postBuffers
   */
  constructor (headerBuffers, httpBuffers, postBuffers) {
    /**
     * @type {Object}
     */
    this.warcHeader = parseWarcRecordHeader(headerBuffers)

    /**
     * @type {Object}
     */
    this.httpHeaders = this._parseHttpHeaders(httpBuffers)

    if (this.method.toLowerCase() === 'post') {
      /**
       * @desc The post data of the request. This property is only on a {@link WARCRequestRecord} if it corresponds to
       * a post request
       * @type {Buffer}
       */
      this.postBuffer = Buffer.concat(postBuffers)
    }

    /**
     * @type {string}
     */
    this.type = 'request'

    /**
     * @type {?string}
     */
    this.method = null

    /**
     * @type {?string}
     */
    this.requestLine = null

    /**
     * @type {?string}
     */
    this.httpVersion = null
  }

  /**
   * @desc Parses the request HTTP headers
   * @param {Buffer[]} bufs the request HTTP headers
   * @return {Object}
   * @private
   */
  _parseHttpHeaders (bufs) {
    let content = {}
    let len = bufs.length
    let i = 1
    let line
    let match
    this.requestLine = bufs[0].toString('utf8').trim()
    // disabling eslint to account for ES6 array destructuring
    let [meth, path, httpV] = this.requestLine.split(' ') // eslint-disable-line
    this.method = meth
    this.httpVersion = httpV
    let lastMatch
    for (; i < len; ++i) {
      line = bufs[i].toString('utf8').trim()
      match = headerRe.exec(line)
      if (match) {
        let [_, m1, m2] = match // eslint-disable-line
        content[m1] = m2
        lastMatch = m1
      } else {
        // because really long set cookie and friends
        if (lastMatch) {
          content[lastMatch] += line
        } else {
          console.log('boooo WarcRequestRecord._parseHeaders')
        }
      }
    }
    return content
  }

  /**
   * @return {string} WARC-Record-ID
   */
  get recordId () {
    return this.warcHeader['WARC-Record-ID']
  }

  /**
   * @return {string} WARC-Target-URI
   */
  get targetURI () {
    return this.warcHeader['WARC-Target-URI']
  }

  /**
   * @return {string} WARC-HEADER:Content-Type
   */
  get warcContentType () {
    return this.warcHeader['Content-Type']
  }

  /**
   * @return {number} WARC-HEADER:Content-Length
   */
  get warcContentLength () {
    return this.warcHeader['Content-Length']
  }
}

/**
 * @desc WARC-TYPE: response
 */
class WARCResponseRecord {
  /**
   * @desc Create a new WARCResponseRecord
   * @param {Buffer[]} headerBuffers
   * @param {Buffer[]} httpBuffers
   * @param {Buffer[]} bodyBuffers
   */
  constructor (headerBuffers, httpBuffers, bodyBuffers) {
    /**
     * @type {Object}
     */
    this.warcHeader = parseWarcRecordHeader(headerBuffers)

    /**
     * @type {Object}
     */
    this.httpHeaders = this._parseHttpHeaders(httpBuffers)

    /**
     * @type {Buffer}
     */
    this.bodyBuffer = Buffer.concat(bodyBuffers)

    /**
     * @type {string}
     */
    this.type = 'response'

    /**
     * @type {?number}
     */
    this.statusCode = null

    /**
     * @type {?string}
     */
    this.statusReason = null

    /**
     * @type {?string}
     */
    this.statusLine = null

    /**
     * @type {?string}
     */
    this.httpVersion = null
  }

  /**
   * @desc Parses the response HTTP headers
   * @param {Buffer[]} bufs the response HTTP headers
   * @return {Object}
   * @private
   */
  _parseHttpHeaders (bufs) {
    let content = {}
    let len = bufs.length
    let i = 1
    let line
    let match
    this.statusLine = bufs[0].toString('utf8').trim()
    let [httpV, statusCode, statusReason] = this.statusLine.split(' ')
    this.statusCode = parseInt(statusCode)
    this.statusReason = statusReason
    this.httpVersion = httpV
    let lastMatch
    for (; i < len; ++i) {
      line = bufs[i].toString('utf8').trim()
      match = headerRe.exec(line)
      if (match) {
        // disabling eslint to account for ES6 array destructuring
        let [_, m1, m2] = match // eslint-disable-line
        if (m1.toLowerCase() === 'content-length') {
          content[m1] = parseInt(m2)
        } else {
          content[m1] = m2
        }
        lastMatch = m1
      } else {
        // because really long set cookie and friends
        if (lastMatch) {
          content[lastMatch] += line
        } else {
          console.log('boooo WarcResponseRecord._parseHeaders')
        }
      }
    }
    return content
  }

  /**
   * @return {string} WARC-Record-ID
   */
  get recordId () {
    return this.warcHeader['WARC-Record-ID']
  }

  /**
   * @return {string} WARC-Target-URI
   */
  get targetURI () {
    return this.warcHeader['WARC-Target-URI']
  }

  /**
   * @return {string} WARC-HEADER:Content-Type
   */
  get warcContentType () {
    return this.warcHeader['Content-Type']
  }

  /**
   * @return {number} WARC-HEADER:Content-Length
   */
  get warcContentLength () {
    return this.warcHeader['Content-Length']
  }
}

module.exports = {
  WARCInfoRecord,
  WARCMetaDataRecord,
  WARCRequestRecord,
  WARCResponseRecord
}

/**
 * @desc Capture ``(key):\s(value)`` separated pairs
 * @type {RegExp}
 */
const headerRe = /([^:]+):\s(.+)/

/**
 * @desc Capture the WARC Record Id or WARC Concurrent To Id
 * @type {RegExp}
 */
const recIdRE = /<[a-z]+:[a-z]+:([^>]+)>/

/**
 * @desc Parse a WARC Records headers not HTTP Header parser
 * @param {Buffer[]} bufs the WARC Records header lines
 * @return {Object}
 */
function parseWarcRecordHeader (bufs) {
  let rheader = {}
  let len = bufs.length
  let i = 1
  let line
  let match
  line = bufs[0].toString('utf8').trim()
  rheader['WARC'] = line.slice(line.indexOf('/') + 1)
  for (; i < len; ++i) {
    line = bufs[i].toString('utf8').trim()
    match = headerRe.exec(line)
    if (match) {
      // disabling eslint to account for ES6 array destructuring
      let [str, m1, m2] = match // eslint-disable-line
      if (m1 === 'WARC-Record-ID' || m1 === 'WARC-Concurrent-To') {
        let [_, id] = recIdRE.exec(m2) // eslint-disable-line
        rheader[m1] = id
      } else if (m1 === 'Content-Length') {
        rheader[m1] = parseInt(m2)
      } else {
        rheader[m1] = m2
      }
    } else {
      console.log('boooo parseWarcRecordHeader')
    }
  }
  return rheader
}

/**
 * @desc Parse a WARC Metadata records metadata content
 * @param {Buffer[]} bufs the WARC Metadata records content lines
 * @return {Object}
 */
function parseWarcInfoMetaDataContent (bufs) {
  let content = {}
  let len = bufs.length
  let i = 0
  let line
  let match
  for (; i < len; ++i) {
    line = bufs[i].toString('utf8').trim()
    match = headerRe.exec(line)
    if (match) {
      // disabling eslint to account for ES6 array destructuring
      let [str, m1, m2] = match // eslint-disable-line
      if (m1 === 'outlink') {
        if (!content[m1]) {
          content[m1] = []
        }
        content[m1].push(m2)
      } else {
        content[m1] = m2
      }
    } else {
      console.log('boooo parseWarcInfoMetaDataContent')
    }
  }
  return content
}

module.exports = {
  headerRe,
  recIdRE,
  parseWarcInfoMetaDataContent,
  parseWarcRecordHeader
}
